import React, { Component } from 'react';
import "../AppLibrary/AppLibrary.css";
import VideoElement from "../VideoElement/VideoElement";



export default function AppLibrary() {

  const array = ["https://stream.mux.com/jFpNGFktuDL7eVFu9mjcsaPb23gqdk5WKZ59Sh402Ctg.m3u8",
                    "https://stream.mux.com/jFpNGFktuDL7eVFu9mjcsaPb23gqdk5WKZ59Sh402Ctg.m3u8",
                    "https://stream.mux.com/jFpNGFktuDL7eVFu9mjcsaPb23gqdk5WKZ59Sh402Ctg.m3u8",
                    ]


  return (


    <div>
      <h1>Video library</h1>
      <div>
          {array.map(url => 
            <div style={{height:"500px",width:"500px"}}>
              <VideoElement src={url}/>
            </div>
          )}
      </div>



    </div>


  );
}
